import app from "firebase/app";
import "firebase/auth";

const Hi = () => {
  const auth = app.auth();

  const onClick = async (ev) => {
    try {
      auth.signInWithCustomToken("token");
    } catch (error) {}
  };

  console.log("firebase: ", auth);

  return <h1>Hi</h1>;
};

export default Hi;
